package com.hsd.asmfsx.bean;public class PictureBean extends BaseBean {	private Integer picture_ID;	private String picture_URL;	private String picture_desc;	private FriendCircleBean friendCircle;	private CommentBean comment;	public CommentBean getComment() {		return comment;	}	public void setComment(CommentBean comment) {		this.comment = comment;	}	public Integer getPicture_ID() {		return picture_ID;	}	public String getPicture_URL() {		return picture_URL;	}	public String getPicture_desc() {		return picture_desc;	}	public FriendCircleBean getFriendCircle() {		return friendCircle;	}	public void setPicture_ID(Integer picture_ID) {		this.picture_ID = picture_ID;	}	public void setPicture_URL(String picture_URL) {		this.picture_URL = picture_URL;	}	public void setPicture_desc(String picture_desc) {		this.picture_desc = picture_desc;	}	public void setFriendCircle(FriendCircleBean friendCircle) {		this.friendCircle = friendCircle;	}}